e the same style for ale the modules located on the specific module position.</p>\r\n<p class=\"numblocks num-3\"><span>02</span>The <strong>clear</strong> suffix is very useful to create banners or images without additional borders, margins and paddings. The clear suffix is also very useful inside the <strong>mainbody</strong>, <strong>mainbody_top</strong> and <strong>mainbody_bottom</strong> module positions.</p>\r\n<p class=\"numblocks num-3\"><span>03</span>For the News Show Pro GK5, Tabs GK5 and Image Show GK4 modules please always disable usage of the default CSS styles in the module settings to avoid loading of the unnecessary CSS stylesheets.</p>\r\n<p class=\"numblocks num-3\"><span>04</span>For the subpages where you want to achieve the bottom modules placed in one column, please use page suffix <strong>onepage</strong> in the template settings - then all modules placed on the module positions <strong>bottom1</strong> will be placed in one column.</p>\r\n<p class=\"numblocks num-3\"><span>05</span>On subpages with the <strong>onepage</strong> suffix you can use the <strong>greybg</strong> suffix to achieve the different backgrounds on the odd/even modules.</p>','',1,7,'2011-01-13 12:30:01',142,'','2013-05-22 07:58:44',838,0,'0000-00-00 00:00:00','2011-01-13 12:30:01','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",