\r\n    <dd>Use your own domain</dd>\r\n    <dd><a href=\"#\">Choose</a></dd>\r\n  </dl>\r\n</div>\r\n<p>Price table Custom HTML is based on the following structure:</p>\r\n<pre>&lt;div class=\"gkPriceTable col3\"&gt;\r\n&lt;dl&gt;\r\n&lt;dt&gt;Basic&lt;/dt&gt;\r\n&lt;dd class=\"gkPrice\"&gt;$15&lt;small&gt;/ month&lt;/small&gt;&lt;/dd&gt;\r\n&lt;dd&gt;Access to all themes&lt;/dd&gt;\r\n&lt;dd&gt;Regular theme updates&lt;/dd&gt;\r\n&lt;dd&gt;Email /  Phone Support&lt;/dd&gt;\r\n&lt;dd&gt;Use your own domain&lt;/dd&gt;\r\n&lt;dd&gt;&lt;a href=\"#\"&gt;Choose&lt;/a&gt;&lt;/dd&gt;\r\n&lt;/dl&gt;\r\n\r\n&lt;dl class=\"gkPremium\"&gt;\r\n&lt;dt&gt;Premium&lt;/dt&gt;\r\n&lt;dd class=\"gkPrice\"&gt;$99&lt;small&gt;/ month&lt;/small&gt;&lt;/dd&gt;\r\n&lt;dd&gt;Access to all themes&lt;/dd&gt;\r\n&lt;dd&gt;Regular theme updates&lt;/dd&gt;\r\n&lt;dd&gt;Email /  Phone Support&lt;/dd&gt;\r\n&lt;dd&gt;Use your own domain&lt;/dd&gt;\r\n&lt;dd&gt;Try it for a month!&lt;/dd&gt;\r\n&lt;dd&gt;&lt;a href=\"#\"&gt;Choose&lt;/a&gt;&lt;/dd&gt;\r\n&lt;/dl&gt;\r\n\r\n&lt;dl&gt;\r\n&lt;dt&gt;Plus&lt;/dt&gt;\r\n&lt;dd class=\"gkPrice\"&gt;$29&lt;small&gt;/ month&lt;/small&gt;&lt;/dd&gt;\r\n&lt;dd&gt;Access to all themes&lt;/dd&gt;\r\n&lt;dd&gt;Regular theme updates&lt;/dd&gt;\r\n&lt;dd&gt;Email /  Phone Support&lt;/dd&gt;\r\n&lt;dd&gt;Use your own domain&lt;/dd&gt;\r\n&lt;dd&gt;&lt;a href=\"#\"&gt;Choose&lt;/a&gt;&lt;/dd&gt;\r\n&lt;/dl&gt;\r\n&lt;/div&gt;</pre>\r\n<p>The main wrapper contains two clases: the <strong>gkPriceTable</strong> class is required as a base of the CSS styling and the second class is used to specify the amount of columns - you can use classes <strong>col1</strong>-<strong>col5</strong>.</p>\r\n<p>Every column is specified by <strong>dl</strong> element (with <strong>gkPremium</strong> class the column will be highlighted) - in the <strong>dt</strong> element you can specify the table column title. In the <strong>dd</strong> element with <strong>gkPrice</strong> class you can specify the price - using the <strong>small</strong> element you can specify te service period time.</p>\r\n<p>Adding of the button at the bottom is very simple - it needs just to add the link element in the <strong>dd</strong> element.</p>\r\n','',1,7,'2013-05-16 14:44:04',838,'','2013-05-23 09:43:26',295,0,'0000-00-00 00:00:00','2013-05-16 14:44:04','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',5,3,'','',1,100,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(84,164,'Static title','static-title','<h4>Description</h4>\r\n<p>The gk_creativity Image Show style allows you to show static title/text on all slides.</p>\r\n\r\n<h4>Configuration</h4>\r\n<p>To achieve this effect you have to only use the \"None\" animation type in the title/text or in the module style settings.</p>','',1,9,'2013-05-27 06:09:18',838,'','2013-05-27 11:09:45',838,0,'0000-00-00 00:00:00','2013-05-27 06:09:18','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"ima