le we have used the following settings</p>\r\n\r\n<h4>Slide 1</h4>\r\n<p><strong>Image:</strong> #7484ff</p>\r\n<p><strong>Title:</strong> First slide</p>\r\n<p><strong>Text:</strong> You can use few icons in the content</p>\r\n\r\n<h4>Slide 2</h4>\r\n<p><strong>Image:</strong> #7484ff</p>\r\n<p><strong>Title:</strong> Second slide</p>\r\n<p><strong>Text:</strong> [anim-opacity][icon-mobile-phone,66,wibrateanim2] [icon-heart,66,pulseanim] [icon-bell,66,flickeranim] [icon-spinner,66,spin]</p>\r\n\r\n<h4>Slide 3</h4>\r\n<p><strong>Image:</strong> #7484ff</p>\r\n<p><strong>Title:</strong> Third slide</p>\r\n<p><strong>Text:</strong> [icon-info] You can combine text with icons</p>','',1,9,'2013-05-27 06:10:20',838,'','2013-05-27 11:09:37',838,0,'0000-00-00 00:00:00','2013-05-27 06:10:20','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',4,4,'','',1,5,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(87,167,'Different animation for each slide','different-animation-for-each-slide','<h4>Description</h4>\r\n<p>The gk_creativity Image Show style allows you to specify different animations for every title and text on the slides.</p>\r\n\r\n<h4>Configuration</h4>\r\n<p>To achieve this effect you have to use the following syntax in the title/text:</p>\r\n\r\n<pre>[anim-ANIMATION_NAME]</pre>\r\n\r\n<p>In the above example we have used the following settings</p>\r\n\r\n<h4>Slide 1</h4>\r\n<p><strong>Image:</strong> #7484ff</p>\r\n<p><strong>Title:</strong> First slide[anim-slide_left]</p>\r\n<p><strong>Text:</strong> [anim-slide_right]You can specify different animation style for each slide</p>\r\n\r\n<h4>Slide 2</h4>\r\n<p><strong>Image:</strong> #81ac8b</p>\r\n<p><strong>Title:</strong> Second slide[anim-slide_vertical]</p>\r\n<p><strong>Text:</strong> [anim-slide_left]You can make every slide unique</p>\r\n\r\n<h4>Slide 3</h4>\r\n<p><strong>Image:</strong> #68b5ff</p>\r\n<p><strong>Title:</strong> Third slide[anim-scale]</p>\r\n<p><strong>Text:</strong> [anim-opacity]You can set different animation for the title and text</p>','',1,9,'2013-05-27 06:10:47',838,'','2013-05-27 11:09:04',838,0,'0000-00-00 00:00:00','2013-05-27 06:10:47','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_no