','<h4>Description</h4>\r\n<p>The gk_creativity Image Show style allows you to combine the available animations.</p>\r\n\r\n<h4>Configuration</h4>\r\n<p>To achieve this effect you have to use the following syntax in the title/text:</p>\r\n\r\n<pre>[anim-ANIMATION_NAME1 ANIMATION_NAME2]</pre>\r\n\r\n<p>In the above example we have used the following settings</p>\r\n\r\n<h4>Slide 1</h4>\r\n<p><strong>Image:</strong> #7484ff</p>\r\n<p><strong>Title:</strong> First slide</p>\r\n<p><strong>Text:</strong> [anim-slide_right scale]You can combine few animations into one effect</p>\r\n\r\n<h4>Slide 2</h4>\r\n<p><strong>Image:</strong> #68b5ff</p>\r\n<p><strong>Title:</strong> Second slide</p>\r\n<p><strong>Text:</strong> [anim-rotate_x_center slide_vertical] Example with slide and rotation</p>','',1,9,'2013-05-27 06:12:04',838,'','2013-05-27 11:09:56',838,0,'0000-00-00 00:00:00','2013-05-27 06:12:04','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',3,1,'','',1,6,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(91,171,'Frontpage version','frontpage-version','<h4>Description</h4>\r\n<p>The above configuration of the Image Show gk_creativity style shows the most important features of this style:</p>\r\n\r\n<ul>\r\n<li>Possibility of use images and colors in the slides background</li>\r\n<li>Support for the icons in the title and text</li>\r\n<li>Animated icons</li>\r\n<li>Possibility of defining animations for each slide elements</li>\r\n</ul>\r\n\r\n<h4>Configuration</h4>\r\n<p>In the above example we have used the following settings</p>\r\n\r\n<h4>Slide 1</h4>\r\n<p><strong>Image:</strong> #7484ff</p>\r\n<p><strong>Title:</strong> Creativity[anim-slide_left]</p>\r\n<p><strong>Text:</strong> [anim-slide_right]Get everything you need and create an awesome website</p>\r\n\r\n<h4>Slide 2</h4>\r\n<p><strong>Image:</strong> images/demo/desk.jpg</p>\r\n<p><strong>Title:</strong> Set your own header picture[anim-slide_right]</p>\r\n<p><strong>Text:</strong> [anim-slide_left]Add picture put description over the image</p>\r\n\r\n<h4>Slide 3</h4>\r\n<p><strong>Image:</strong> #68b5ff</p>\r\n<p><strong>Title:</strong> Add icons to your website[anim-scale]</p>\r\n<p><strong>Text:</strong> [anim-opacity][icon-mobile-phone,66,wibrateanim2] [icon-heart,66,pulseanim] [icon-bell,66,flickeranim] [icon-spinner,66,spin]</p>','',1,9,'2013-05-27 06:14:07',838,'','2013-05-27 11:09:27',838,0,'0000-00-00 00:00:00','2013-05-27 06:14:07','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',4,0,'','',1,3,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(92,172,'Image Show GK4 - gk_creativity style','image-show-gk4-gk-creativity-style','<p>In the Image Show GK4 gk_creativity style you can specify the following parameters:</p>\r\n\r\n<ul>\r\n<li>pagination display</li>\r\n<li>title animation type</li>\r\n<li>text animation type</li>\r\n<li>background animation type</li>\r\n<li>animation type and interval</li>\r\n<li>thumbnails parameters (if generation of the thumbnails is enabled)</li>\r\n</ul>\r\n\r\n<p>You can use the background color instead of background image - you have to just specify as image the hex color value i.e. #abc123</p>\r\n\r\n<h4>Animations</h4>\r\n\r\n<p>For every slide you can use differen text and title animations - you have to specify the animation using the following syntax:</p>\r\n\r\n<pre>[anim-TYPE]Slide title</pre>\r\n\r\n<p>The same syntax can be used in the slide text. Additionally for the better title readability you can put the animation type specification at the end of the title:</p>\r\n\r\n<pre>Slide title[anim-TYPE]</pre>\r\n\r\n<p>Available animation types:</p>\r\n\r\n<ul>\r\n<li><strong>[anim-none]</strong> - useful for static texts</li>\r\n<li><strong>[anim-opacity]</strong></li>\r\n<li><strong>[anim-slide_vertical]</strong></li>\r\n<li><strong>[anim-slide_left]</strong></li>\r\n<li><strong>[anim-slide_right]</strong></li>\r\n<li><strong>[anim-scale]</strong></li>\r\n<li><strong>[anim-skew_left]</strong></li>\r\n<li><strong>[anim-skew_right]</strong></li>\r\n<li><strong>[anim-rotate_x_center]</strong></li>\r\n<li><strong>[anim-rotate_x_top]</strong></li>\r\n<li><strong>[anim-rotate_x_bottom]</strong></li>\r\n<li><strong>[anim-rotate_y_center]</strong></li>\r\n<li><strong>[anim-rotate_y_left]</strong></li>\r\n<li><strong>[anim-rotate_y_right]</strong></li>\r\n</ul>\r\n\r\n\r\n<p>Additionally you can combine few animaton types into one:</p>\r\n\r\n<pre>[anim-slide_left rotate_x_center]</pre>\r\n\r\n<h4>Icons</h4>\r\n\r\n<p>In the text and titles you can put the Font Awesome icons using the following syntax:</p>\r\n\r\n<ul>\r\n<li><strong>[icon-refresh]</strong> - puts icon using the text font-size.</li>\r\n<li><strong>[icon-refresh,32]</strong> - puts icon using specified font-size</li>\r\n<li><strong>[icon-refresh,spin]</strong> - puts icon with specified animation</li>\r\n<li><strong>[icon-refresh,32,spin]</strong> - puts icon with specified font-size and animation</li>\r\n</ul>\r\n\r\n<p>Available icon animations:</p>\r\n\r\n<ul>\r\n<li><strong>spin</strong> - rotate animation</li>\r\n<li><strong>pulseanim</strong> - scale animation</li>\r\n<li><strong>flickeranim</strong> - rotate animation on the limited angles (-30deg - 30deg)</li>\r\n<li><strong>wibrateanim1</strong> - continous wibrate animation</li>\r\n<li><strong>wibrateanim2</strong> - short wibrate animation</li>\r\n</ul>\r\n\r\n<h4>Bottom link</h4>\r\n\r\n<p>You can specify the text of the bottom link:</p>\r\n\r\n<pre>[GavickPro]http://www.gavick.com</pre>\r\n\r\n<p>In the above case you can specify your own text. If the own text is not specified, then the language file text will be used.</p>','',1,7,'2013-05-27 10:01:09',838,'','2013-05-28 11:43:19',838,0,'0000-00-00 00:00:00','2013-05-27 10:01:09','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',5,2,'','',1,6,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(93,173,'Plugin GK Contact','plugin-gk-contact','<p>The GK Contact plugin is very simple contact form plugin - you have to just put inside the article or module the following plugin code:</p>\r\n\r\n<pre>{<strong></strong>GKCONTACT}</pre>\r\n\r\n<p>The plugin configuration is separated into three sections:</p>\r\n\r\n<ul>\r\n<li>\r\n<h4>Form</h4>\r\n<ul>\r\n<li><strong>Name field</strong> - enable/disable name field</li>\r\n<li><strong>E-mail field</strong> - enable/disable e-mail field</li>\r\n<li><strong>Title field</strong> - enable/disable title field</li>\r\n<li><strong>Use reCAPTCHA</strong> - enable/disable reCAPTCHA - remember to proper configure reCAPTCHA in the Joomla! Settings before enabling it in the plugin.</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<h4>Address area</h4>\r\n<ul>\r\n<li><strong>Show address area</strong> - if enabled then the second column with the address data is displayed</li>\r\n<li><strong>Address area title</strong> - specifies the title displayed over the address data</li>\r\n<li><strong>Address text</strong> - specifies the address data</li>\r\n<li><strong>Address area footer</strong> - specifies the text displayed under the address data</li>\r\n<li><strong>Facebook URL</strong> - if not empty then the Facebook icon with link is displayed</li>\r\n<li><strong>Twitter URL</strong> - if not empty then the Twitter icon with link is displayed</li>\r\n<li><strong>Google+ URL</strong> - if not empty then the Google+ icon with link is displayed</li>\r\n<li><strong>Linkedin URL</strong> - if not empty then the Linkedin icon with link is displayed</li>\r\n<li><strong>Pinterest URL</strong> - if not empty then the Pinterest icon with link is displayed</li>\r\n<li><strong>RSS URL</strong> - if not empty then the RSS icon with link is displayed</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<h4>Mail configuration</h4>\r\n<ul>\r\n<li><strong>Receiver\'s e-mail</strong> - the e-mail where the messages will be send.</li>\r\n<li><strong>E-mail title</strong> - custom e-mail title</li>\r\n</ul>\r\n</li>\r\n</ul>','',1,7,'2013-05-28 10:07:23',838,'','2013-05-28 10:55:24',838,0,'0000-00-00 00:00:00','2013-05-28 10:07:23','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',2,1,'','',1,3,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(94,174,'Page layout','page-layout','<p>This article describes additional features and tricks used in this template.</p>\r\n\r\n<h4>One page layout</h4>\r\n\r\n<p>If you want to achieve the one page layout you should use for the specific page suffix <strong>onepage</strong> in the template settings. Then all modules on the <strong>bottom1-2</strong> will be displayed with the 100% width. Additionally you can use suffix <strong>greybg</strong> to achieve the grey background in the selected modules.</p>\r\n          \r\n<h4>Menu</h4>\r\n\r\n<p>For the <strong>bottom1</strong> module position we have prepared special feature which adds unique ID for every module using the following schema:</p>\r\n<pre>#gkBottom1-X</pre>\r\n<p>Where <strong>X</strong> is a number of the module. Then you can create menu with anchors to the specific blocks of the website.</p>\r\n       \r\n<p>We recommend to prepare two template instances - one for the frontpage and one for the rest of subpages. Then you can specify differents main menus for every template instance.</p>\r\n\r\n<h4>Scroll animations</h4>\r\n         \r\n<p>The template contains the animation system based on the scroll event - some page elements can be displayed after scrolling the page to the specific point.</p>\r\n\r\n<p>The animation engine uses two types of animation:</p>\r\n\r\n<ul>\r\n<li>Single animation</li>\r\n<li>Animation queue</li>\r\n</ul>\r\n\r\n<h5>Single animation</h5>\r\n\r\n<p>You have to add class <strong>animate</strong> to the element - the class <strong>loaded</strong> will be added when the user will scroll the page to area with this element.</p>\r\n\r\n<h5>Animation queue</h5>\r\n\r\n<p>You have to add class <strong>animate_queue</strong> to the container with the elements which have class <strong>animate_queue_element</strong> - then these elements will be animated one after another with delay 100ms.</p>','',1,7,'2013-05-28 10:45:31',838,'','2013-05-28 10:56:07',838,0,'0000-00-00 00:00:00','2013-05-28 10:45:31','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',2,0,'','',1,4,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');


