pecification at the end of the title: Slide title[anim-TYPE] Available animation types: [anim-none] - useful for static texts [anim-opacity] [anim-slide_vertical] [anim-slide_left] [anim-slide_right] [anim-scale] [anim-skew_left] [anim-skew_right] [anim-rotate_x_center] [anim-rotate_x_top] [anim-rotate_x_bottom] [anim-rotate_y_center] [anim-rotate_y_left] [anim-rotate_y_right] Additionally you can combine few animaton types into one: [anim-slide_left rotate_x_center] Icons In the text and titles you can put the Font Awesome icons using the following syntax: [icon-refresh] - puts icon using the text font-size. [icon-refresh,32] - puts icon using specifiedfont-size [icon-refresh,spin] - puts icon with specified animation [icon-refresh,32,spin] - puts icon with specified font-size and animation Available icon animations: spin - rotate animation pulseanim - scale animation flickeranim - rotate animation on the limited angles (-30deg - 30deg) wibrateanim1 - continous wibrate animation wibrateanim2 - short wibrate animation Bottom link You can specify the text of the bottom link: [GavickPro]http://www.gavick.com In the above case you can specify your own text. If the own text is not specified, then the language file text will be used.\";s:9:\"published\";N;s:5:\"state\";i:1;s:6:\"access\";s:1:\"1\";s:8:\"language\";s:1:\"*\";s:18:\"publish_start_date\";s:19:\"2013-05-27 10:01:09\";s:16:\"publish_end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"start_date\";s:19:\"2013-05-27 10:01:09\";s:8:\"end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"list_price\";N;s:10:\"sale_price\";N;s:7:\"type_id\";i:4;}'),(259,'index.php?option=com_content&view=article&id=93','index.php?option=com_content&view=article&id=93:plugin-gk-contact&catid=7:template&Itemid=714','Plugin GK Contact','The GK Contact plugin is very simple contact form plugin - you have to just put inside the article or module the following plugin code: { GKCONTACT} The plugin configuration is separated into three sections: Form Name field - enable/disable name field E-m','2013-05-28 12:55:24','739aebd48aeafb1f0335474aa92f56b5',1,1,1,'*','2013-05-28 10:07:23','0000-00-00 00:00:00','2013-05-28 10:07:23','0000-00-00 00:00:00',0,0,4,'O:19:\"FinderIndexerResult\":18:{s:11:\"\0*\0elements\";a:24:{s:2:\"id\";s:2:\"93\";s:5:\"alias\";s:17:\"plugin-gk-contact\";s:7:\"summary\";s:1918:\"<p>The GK Contact plugin is very simple contact form plugin - you have to just put inside the article or module the following plugin code:</p>\r\n\r\n<pre>{<strong></strong>GKCONTACT}</pre>\r\n\r\n<p>The plugin configuration is separated into three sections:</p>\r\n\r\n<ul>\r\n<li>\r\n<h4>Form</h4>\r\n<ul>\r\n<li><strong>Name field</strong> - enable/disable name field</li>\r\n<li><strong>E-mail field</strong> - enable/disable e-mail field</li>\r\n<li><strong>Title field</strong> - enable/disable title field</li>\r\n<li><strong>Use reCAPTCHA</strong> - enable/disable reCAPTCHA - remember to proper configure reCAPTCHA in the Joomla! Settings before enabling it in the plugin.</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<h4>Address area</h4>\r\n<ul>\r\n<li><strong>Show address area</strong> - if enabled then the second column with the address data is displayed</li>\r\n<li><strong>Address area title</strong> - specifies the title displayed over the address data</li>\r\n<li><strong>Address text</strong> - specifies the address data</li>\r\n<li><strong>Address area footer</strong> - specifies the text displayed under the address data</li>\r\n<li><strong>Facebook URL</strong> - if not empty then the Facebook icon with link is displayed</li>\r\n<li><strong>Twitter URL</strong> - if not empty then the Twitter icon with link is displayed</li>\r\n<li><strong>Google+ URL</strong> - if not empty then the Google+ icon with link is displayed</li>\r\n<li><strong>Linkedin URL</strong> - if not empty then the Linkedin icon with link is displayed</li>\r\n<li><strong>Pinterest URL</strong> - if not empty then the Pinterest icon with link is displayed</li>\r\n<li><strong>RSS URL</strong> - if not empty then the RSS icon with link is displayed</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<h4>Mail configuration</h4>\r\n<ul>\r\n<li><strong>Receiver\'s e-mail</strong> - the e-mail where the messages will be send.</li>\r\n<li><strong>E-mail title</strong> - custom e-mail title</li>\r\n</ul>\r\n</li>\r\n</ul>\";s:4:\"body\";s:0:\"\";s:5:\"catid\";s:1:\"7\";s:10:\"created_by\";s:3:\"838\";s:16:\"created_by_alias\";s:0:\"\";s:8:\"modified\";s:19:\"2013-05-28 10:55:24\";s:11:\"modified_by\";s:3:\"838\";s:6:\"params\";O:9:\"JRegistry\":1:{s:7:\"\0*\0data\";O:8:\"stdClass\":68:{s:14:\"article_layout\";s:9:\"_:default\";s:10:\"show_title\";s:1:\"1\";s:11:\"link_titles\";s:1:\"1\";s:10:\"show_intro\";s:1:\"1\";s:13:\"show_category\";s:1:\"1\";s:13:\"link_category\";s:1:\"1\";s:20:\"show_parent_category\";s:1:\"0\";s:20:\"link_parent_category\";s:1:\"0\";s:11:\"show_author\";s:1:\"1\";s:11:\"link_author\";s:1:\"0\";s:16:\"show_create_date\";s:1:\"1\";s:16:\"show_modify_date\";s:1:\"0\";s:17:\"show_publish_date\";s:1:\"0\";s:20:\"show_item_navigation\";s:1:\"1\";s:9:\"show_vote\";s:1:\"0\";s:13:\"show_readmore\";s:1:\"1\";s:19:\"show_readmore_title\";s:1:\"0\";s:14:\"readmore_limit\";s:3:\"100\";s:10:\"show_icons\";s:1:\"1\";s:15:\"show_print_icon\";s:1:\"1\";s:15:\"show_email_icon\";s:1:\"1\";s:9:\"show_hits\";s:1:\"1\";s:11:\"show_noauth\";s:1:\"0\";s:13:\"urls_position\";s:1:\"1\";s:23:\"show_publishing_options\";s:1:\"1\";s:20:\"show_article_options\";s:1:\"1\";s:25:\"show_urls_images_frontend\";s:1:\"1\";s:24:\"show_urls_images_backend\";s:1:\"1\";s:7:\"targeta\";i:0;s:7:\"targetb\";i:0;s:7:\"targetc\";i:0;s:11:\"float_intro\";s:4:\"left\";s:14:\"float_fulltext\";s:4:\"left\";s:15:\"category_layout\";s:6:\"_:blog\";s:19:\"show_category_title\";s:1:\"1\";s:16:\"show_description\";s:1:\"0\";s:22:\"show_description_image\";s:1:\"0\";s:8:\"maxLevel\";s:1:\"1\";s:21:\"show_empty_categories\";s:1:\"0\";s:16:\"show_no_articles\";s:1:\"