 URL - if not empty then the Linkedin icon with link is displayed Pinterest URL - if not empty then the Pinterest icon with link is displayed RSS URL - if not empty then the RSS icon with link is displayed Mail configuration Receiver\'s e-mail - the e-mail where the messages will be send. E-mail title - custom e-mail title\";s:9:\"published\";N;s:5:\"state\";i:1;s:6:\"access\";s:1:\"1\";s:8:\"language\";s:1:\"*\";s:18:\"publish_start_date\";s:19:\"2013-05-28 10:07:23\";s:16:\"publish_end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"start_date\";s:19:\"2013-05-28 10:07:23\";s:8:\"end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"list_price\";N;s:10:\"sale_price\";N;s:7:\"type_id\";i:4;}'),(260,'index.php?option=com_content&view=article&id=94','index.php?option=com_content&view=article&id=94:page-layout&catid=7:template&Itemid=715','Page layout','This article describes additional features and tricks used in this template. One page layout If you want to achieve the one page layout you should use for the specific page suffix onepage in the template settings. Then all modules on the bottom1-2 will be','2013-05-28 12:56:07','7e83de0b7e40be26ea9bf601107c3bbb',1,1,1,'*','2013-05-28 10:45:31','0000-00-00 00:00:00','2013-05-28 10:45:31','0000-00-00 00:00:00',0,0,4,'O:19:\"FinderIndexerResult\":18:{s:11:\"\0*\0elements\";a:24:{s:2:\"id\";s:2:\"94\";s:5:\"alias\";s:11:\"page-layout\";s:7:\"summary\";s:1804:\"<p>This article describes additional features and tricks used in this template.</p>\r\n\r\n<h4>One page layout</h4>\r\n\r\n<p>If you want to achieve the one page layout you should use for the specific page suffix <strong>onepage</strong> in the template settings. Then all modules on the <strong>bottom1-2</strong> will be displayed with the 100% width. Additionally you can use suffix <strong>greybg</strong> to achieve the grey background in the selected modules.</p>\r\n          \r\n<h4>Menu</h4>\r\n\r\n<p>For the <strong>bottom1</strong> module position we have prepared special feature which adds unique ID for every module using the following schema:</p>\r\n<pre>#gkBottom1-X</pre>\r\n<p>Where <strong>X</strong> is a number of the module. Then you can create menu with anchors to the specific blocks of the website.</p>\r\n       \r\n<p>We recommend to prepare two template instances - one for the frontpage and one for the rest of subpages. Then you can specify differents main menus for every template instance.</p>\r\n\r\n<h4>Scroll animations</h4>\r\n         \r\n<p>The template contains the animation system based on the scroll event - some page elements can be displayed after scrolling the page to the specific point.</p>\r\n\r\n<p>The animation engine uses two types of animation:</p>\r\n\r\n<ul>\r\n<li>Single animation</li>\r\n<li>Animation queue</li>\r\n</ul>\r\n\r\n<h5>Single animation</h5>\r\n\r\n<p>You have to add class <strong>animate</strong> to the element - the class <strong>loaded</strong> will be added when the user will scroll the page to area with this element.</p>\r\n\r\n<h5>Animation queue</h5>\r\n\r\n<p>You have to add class <strong>animate_queue</strong> to the container with the elements which have class <strong>animate_queue_element</strong> - then these elements will be animated one after another with delay 100ms.</p>\";s:4:\"body\";s:0:\"\";s:5:\"catid\";s:1:\"7\";s:10:\"created_by\";s:3:\"838\";s:16:\"created_by_alias\";s:0:\"\";s:8:\"modified\";s:19:\"2013-05-28 10:56:07\";s:11:\"modified_by\";s:3:\"838\";s:6:\"params\";O:9:\"JRegistry\":1:{s:7:\"\0*\0data\";O:8:\"stdClass\":68:{s:14:\"article_layout\";s:9:\"_:default\";s:10:\"show_title\";s:1:\"1\";s:11:\"link_titles\";s:1:\"1\";s:10:\"show_intro\";s:1:\"1\";s:13:\"show_category\";s:1:\"1\";s:13:\"link_category\";s:1:\"1\";s:20:\"show_parent_category\";s:1:\"0\";s:20:\"link_parent_category\";s:1:\"0\";s:11:\"show_author\";s:1:\"1\";s:11:\"link_author\";s:1:\"0\";s:16:\"show_create_date\";s:1:\"1\";s:16:\"show_modify_date\";s:1:\"0\";s:17:\"show_publish_date\";s:1:\"0\"